CREATE DEFINER=`root`@`localhost` PROCEDURE `get_current_price_level`(
input_symbol varchar(45),
input_time datetime,
out var_h1l1_range float,
out var_upper_level float,
out var_lower_level float,
out var_volume_prev_avg int(11)
)
proc_label: BEGIN


declare var_h1 float ;
declare var_l1 float ;
declare  var_h2 float ;
declare  var_l2 float ;
declare  var_h3 float ;
declare  var_l3 float ;

declare  current_price float ;



select     volume_prev_day,
    h1,
    l1,
    h2,
    l2,
    h3,
    l3

from basis_for_calls
where symbol = input_symbol
into    var_volume_prev_avg,
  var_h1  ,
  var_l1  ,
  var_h2  ,
  var_l2  ,
  var_h3  ,
  var_l3  ;

set var_h1l1_range = var_h1 - var_l1;

select price from live_data
where curr_time = input_time
